import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import styles from './SuperAdminDashboard.module.css';

const SuperAdminDashboard = () => {
  const [stats, setStats] = useState({
    totalRequests: 0,
    completedRequests: 0,
    pendingRequests: 0,
    delayedRequests: 0,
    totalResidents: 0
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    // Fetch request statistics
    axios.get('http://localhost:8080/admin/dashboard/stats')
      .then(response => {
        setStats(prev => ({
          ...prev,
          totalRequests: response.data.total,
          completedRequests: response.data.completed,
          pendingRequests: response.data.pending
        }));
        
        // Fetch delayed requests count
        return axios.get('http://localhost:8080/admin/dashboard/requests/delayed');
      })
      .then(response => {
        setStats(prev => ({
          ...prev,
          delayedRequests: response.data.length
        }));
        
        // Fetch resident count
        return axios.get('http://localhost:8080/admin/dashboard/residents/count');
      })
      .then(response => {
        setStats(prev => ({
          ...prev,
          totalResidents: response.data
        }));
        setLoading(false);
      })
      .catch(err => {
        setError(err.message);
        setLoading(false);
      });
  }, []);

  const handleLogout = () => {
    localStorage.clear();
    navigate('/login');
  };

  const handleViewDelayedRequests = () => {
    axios.get('http://localhost:8080/admin/dashboard/requests/delayed')
      .then(response => {
        // Here you would typically navigate to a reports page with this data
        console.log('Delayed requests:', response.data);
        navigate('/reports', { state: { delayedRequests: response.data } });
      })
      .catch(err => {
        setError(err.message);
      });
  };

  if (loading) return <div className={styles.container}>Loading dashboard...</div>;
  if (error) return <div className={styles.container}>Error: {error}</div>;

  return (
    <div className={styles.container}>
      <h2>Super Admin Dashboard</h2>
      <div className={styles.cards}>
        <div className={styles.card}>
          <h4>Total Requests</h4>
          <p>{stats.totalRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Completed</h4>
          <p>{stats.completedRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Pending</h4>
          <p>{stats.pendingRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Delayed</h4>
          <p>{stats.delayedRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Total Residents</h4>
          <p>{stats.totalResidents}</p>
        </div>
      </div>

      <div className={styles.actions}>
        <button onClick={handleViewDelayedRequests} className={styles.reportsButton}>
          View Delayed Requests
        </button>
        <Link to="/reports" className={styles.reportsButton}>
          View All Reports
        </Link>
        <button onClick={handleLogout} className={styles.logoutButton}>
          Logout
        </button>
      </div>
    </div>
  );
};

export default SuperAdminDashboard;
